import './App.css';
import axios from "axios";
import React, {useState, useEffect} from "react";

const UserProfiles = () => {
    const fetchUserProfiles = () => {
      axios.get("http://localhost:8080/api/v1/user-profile")
          .then(response => {
              console.log(response);
          })
          .catch(reason => {
              console.log(reason)
          });
  }

  useEffect(()=> {
      fetchUserProfiles();
  }, []);
}

function App() {
  return (
      <div className="App">
          <UserProfiles />
      </div>
  );
}

export default App;
